import './Images.css';
import React, { Component, createElement } from 'react';

export class Images extends Component {
    constructor(props){
        super(props)
        this.state={
            ImageUrl:'',
            ImageUrlArray:[
                "images/camainpage.jpg","images/includehomepage.jpg","images/includemenu.jpg","images/includeprofile.jpg",
                "images/landingca.jpg","images/landinginclude.jpg", "images/playgroundinclude.jpg","images/programca.jpg",
                "images/programinclude.jpg","images/setprofileca.jpg","images/signinca.jpg","images/signupca.jpg"
            ],
            showModal:false,
            popImageUrl:''
        }
    }

    render() {
        let imageUrlArray = this.state.ImageUrlArray;
        const images = imageUrlArray.map((url,Index)=>{
        //     return (
        //         <img className="singleImage" src={url} key={Index} alt=""/>
        //     )
        // })
        return (
            <div>
                This is how it looks
                <img className="singleImage" src="portfolio/my-react-gallery/public/images/darkorange.jpg" alt=""></img>
                <img className="singleImage" src={url} key={Index} alt=""/>
                <images/>
            </div>
        )
        })
        return(
            <div>
                hope its working
            </div>
        )
    }
}

export default Images
